import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styled from 'styled-components';
import Logo from '../../WhiteLogo.PNG';

const PageContainer = styled.div`
  background-color: #4c4c4c;
  min-height: 101vh;
`;

const TickerTextFirst = styled.div`
  font-size: 40px;
  color: #595959;
  margin-left: 20px;
  display: inline-block;
`;

const Item = styled.li`
  font-size: 40px;
  width: 38%;
  margin: 0 auto;
  margin-top: 90px;
  color: #595959;
`;

const Container = styled.ol`
  color: #595959;
`;

const PriceChangeContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: flex-start;
  align-items: center;
`;

const VolumeText = styled.div`
  font-size: 23px;
  color: white;
  margin-top: 30px;
  margin-left: 10px;
  display: flex;
`;

const HighText = styled.div`
  font-size: 23px;
  color: white;
  margin-top: 30px;
  margin-left: 10px;
  display: flex;
`;

const LowText = styled.div`
  font-size: 23px;
  color: white;
  margin-top: 30px;
  margin-left: 10px;
  display: flex;
`;

const LogoImage = styled.img`
  height: 100px;
  width: 100px;
  margin-top: 30px;
`;

export const SOTD = () => {
  const [data, setData] = useState({});
  const [contentLoaded, setContentLoaded] = useState(false);

  useEffect(() => {
    axios
      .get('http://localhost:5001/api/filtered_stocks')
      .then((response) => {
        console.log('Fetched Data:', response.data);
        setData(response.data);
        setContentLoaded(true);
        console.log('State Data:', data); // Ensure data is correctly set in state
      })
      .catch((error) => {
        console.log('ERROR:', error);
      });
  }, []);

  return (
    <PageContainer>
      {!contentLoaded ? (
        <div>Loading...</div>
      ) : (
        <div>
          <div>
            <div>Day-trading</div>
          </div>
          <div>
            <div>Top picks for today</div>
          </div>
          <Container>
            {data['Day Trading']?.map((stock, index) => {
              console.log('Rendering Stock:', stock);
              return (
                <Item key={index}>
                  <div>
                    <TickerTextFirst>{stock.ticker}</TickerTextFirst>
                    <div>${isNaN(stock.price) ? 'N/A' : stock.price.toFixed(2)}</div>
                  </div>
                  <div>
                    <div>{stock.name}</div>
                    <div>{isNaN(stock.change_percent) ? 'N/A' : stock.change_percent.toFixed(2)}%</div>
                  </div>
                  <hr />
                  <PriceChangeContainer>
                    <VolumeText>
                      <span>VOLUME:</span> {isNaN(stock.volume) ? 'N/A' : stock.volume.toLocaleString()}
                    </VolumeText>
                    <HighText>
                      <span>HIGH:</span> {isNaN(stock.Upper_BB) ? 'N/A' : stock.Upper_BB.toFixed(2)}
                    </HighText>
                    <LowText>
                      <span>LOW:</span> {isNaN(stock.Lower_BB) ? 'N/A' : stock.Lower_BB.toFixed(2)}
                    </LowText>
                  </PriceChangeContainer>
                  <div>
                    <LogoImage src={Logo} alt="Logo" />
                  </div>
                  <div>{stock.ticker} NEWS</div>
                </Item>
              );
            })}
          </Container>
        </div>
      )}
    </PageContainer>
  );
}
